CREATE TABLE features (
  track_id TEXT PRIMARY KEY,
  danceability REAL,
  energy REAL,
  key INTEGER,
  loudness REAL,
  mode INTEGER,
  speechiness REAL,
  acousticness REAL,
  instrumentalness REAL,
  liveness REAL,
  valence REAL,
  tempo REAL,
  time_signature INTEGER,
  FOREIGN KEY (track_id) REFERENCES tracks(id)
);

